INSERT INTO AssemblyDB.`databases` (database_name_displayed, record_id, database_name, database_full_name, web_site, organization, contact_person, taxa, taxonomic_coverage, abstract, version, release_date, SpeciesCount, SpeciesEst, authors_editors, accepted_species_names, accepted_infraspecies_names, species_synonyms, infraspecies_synonyms, common_names, total_names, is_new, coverage, completeness, confidence) VALUES ('The World List of Cycads, online edition', 163, 'The World List of Cycads', 'The World List of Cycads, online edition', 'http://cycadlist.org', 'IUCN / SSC Cycad Specialist Group, Montgomery Botanical Center, Coral Gables, FL, USA; New York Botanical Garden, Bronx NY, USA; Royal Botanic Gardens, Sydney, New South Wales, Australia.', 'Michael Calonje', 'Cycads', 'Plantae - Tracheophyta - Cycadopsida', 'The World List of Cycads is a working list of known cycad species names with the primary goal of providing reliable information on the taxonomy of cycads for use by researchers, conservation planners, and others. It is developed in close collaboration with world''s foremost cycad experts and published under the auspices of the IUCN''s Cycad Specialist Group. The printed edition is published in the proceedings of the International Conference of Cycad Biology, which is held every three years.', '2019-02-01', '2019-02-15', null, null, 'Calonje M., Stevenson D.W., Osborne R.', null, null, null, null, null, null, 1, 'Global', '100', 5);